import ListItem from '../atoms/ListItem';
import Icon from '../atoms/Icon';

const List = ({ listItems, openTab, handleTooltip, direction }) => {
  return (
    <>
      <ul>
        {listItems.map(listItemProps => {
          const { url, name, tooltip } = listItemProps;
          return (
            <ListItem
              className={'contact__list__icon'}
              children={<Icon color={'gray'} iconName={name} size={1} />}
              onClick={
                url
                  ? () => openTab(url)
                  : () => (window.location.href = `mailto:${url}`)
              }
              onMouseEnter={handleTooltip(tooltip)}
              onMouseLeave={handleTooltip(null)}
            />
          );
        })}
      </ul>
      <style jsx>{`
        display: flex;
        list-style: none;
        flex-direction: ${direction};
        justify-content: space-evenly;
        padding: 0;
        width: 40px;
      `}</style>
    </>
  );
};

export default List;
